/* eslint-disable jsx-a11y/alt-text */
import React from 'react';
import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonItem, IonButton, IonLabel, IonGrid, IonRow, IonCol, IonCard, IonCardHeader, IonCardSubtitle, IonCardTitle, IonCardContent } from '@ionic/react';
import './Tab1.css';
import axios from 'axios';

const API_KEY = 'YOUR_API_KEY';
const URL = 'http://localhost:5000/api/guns/4';


const fetchGun = () => {

  return axios({
    url: URL,
    method: 'get'
  }).then(response => {

    console.log(response);
    return response.data;
  })
};

const Gun: React.FC = () => {

    const [gun, setGun] = React.useState([]);

  React.useEffect(() => {

    fetchGun().then(data => setGun(data));

  }, []);

  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>All Guns</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent className="ion-padding">

         <IonGrid>
         <IonRow>

         <IonCol><IonCard>
            <img src={gun.image} />
          <IonCardHeader>
            <IonCardSubtitle>{gun.date}</IonCardSubtitle>
            <IonCardTitle>{gun.name}</IonCardTitle>
          </IonCardHeader>
          <IonCardContent>
          <IonButton href={'activity/'+ gun.gun_id} color="primary" slot="end">Add Activity</IonButton>
          </IonCardContent>
        </IonCard>
        </IonCol>

      </IonRow>
      </IonGrid>
      </IonContent>

    </IonPage>
  );
};


export default Gun;
